        pokemonIndex:''
    }


    componentDidMount(){
        const{name, url} = this.props;
    }

    render() {
        const {name,url } = this.props;

        return (

            <div className ="col-md-3 col-sm-6 mb-5 ">
                <div className="card">
                    <div className="cardHeader">
                    <h1>{name}</h1>
                    <image>{url}</image>
                    </div>
                </div>
            </div>
        )
    }
}
